import React from "react";
import ReactDOM from "react-dom";
import MUIDataTable from "mui-datatables";

class App extends React.Component {
  render() {
    const columns = ["Tasks", "Reach", "Impact", "Confidence", "Effort", "Score"];

    const data = [
      ["Get approval from client regarding proposal", 7621, 3, "38%", 1, 4500],
      ["Create database", 6511, 2, "80%", 9, 4500],
      ["Add list function to legal", 2356, 0.45, "30%", 4, 4500],
      ["New design for menu", 1209, 2, "99%", 2, 4500],
      ["System design", 5729, 1, "45%", 5, 4500],
      ["Architecture design", 7562, 1, "65%", 7, 4500],
      ["Analytics implementation", 3956, 0.1, "87%", 4, 4500],
      ["Refactor code in list view", 5413, 0.5, "23%", 1, 4500],
      ["Add dropdown menus", 3421, 0.25, "12%", 1, 4500],
      ["Login form functionality", 2325, 2, "67%", 2, 4500],
      ["Login form overlay", 8756, 1.5, "89%", 2, 4500],
      ["Upload source to cloud", 1234, 2, "56%", 4, 4500],
      ["Buy hosting", 6321, 4, "26%", 1, 4500],
      ["Gather user info", 8630, 1, "2%", 8, 4500],
      ["Add dropdown function to lists", 4123, 0.25, "34%", 1, 4500],
      ["Buy domain", 3425, 2, "97%", 1, 4500],
      ["Update React", 3456, 1, "90%", 3, 4500],
      ["Get approval from UX", 7534, 3, "83%", 1, 4500],
      ["Find UI framework", 5410, 1, "51%", 4, 4500],
      ["Fix responsive menu problem with tablets", 1034, 0.75, "23%", 1, 4500],
      ["Update database version", 6791, 3, "88%", 8, 4500]
    ];

    const options = {
      filterType: "dropdown",
      responsive: "scroll"
    };

    return (
      <MUIDataTable
        title={"Product Board / Scoring Table"}
        data={data}
        columns={columns}
        options={options}
      />
    );
  }
}

ReactDOM.render(<App />, document.getElementById("root"));
